import React, { Component } from "react";
import {
MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline,
MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem
} from "mdbreact";
import Login from '../containers/Login';
import { Route, Redirect } from 'react-router'
class NavbarPage extends Component {
state = {
  isOpen: false
};

toggleCollapse = () => {
  this.setState({ isOpen: !this.state.isOpen });
}

render() {
  return (
    <Router>
      <MDBNavbar color="indigo" dark expand="md">
        <MDBNavbarBrand>
          <strong className="white-text">Navbar</strong>
        </MDBNavbarBrand>
        <MDBNavbarToggler onClick={this.toggleCollapse} />
        <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
          <MDBNavbarNav left>
            <MDBNavItem active>
              {/* <MDBNavLink to="#!">Home</MDBNavLink> */}
            </MDBNavItem>
            <MDBNavItem>
              {/* <MDBNavLink to="#!">Features</MDBNavLink> */}
            </MDBNavItem>
            <MDBNavItem>
              {/* <MDBNavLink to="#!">Pricing</MDBNavLink> */}
            </MDBNavItem>
            <MDBNavItem>
              <MDBDropdown>
                <MDBDropdownToggle nav caret>
                  <span className="mr-2">메뉴</span>
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem href="#!"><Link to="/Login">로그인</Link></MDBDropdownItem>
                  <MDBDropdownItem href="#!"><Link to="/join">회원가입</Link></MDBDropdownItem>
                  <MDBDropdownItem href="#!"><Link to="/Mypage">마이페이지</Link></MDBDropdownItem>
                  <MDBDropdownItem href="#!"><Link to="/Remove">회원탈퇴</Link></MDBDropdownItem>
                </MDBDropdownMenu>
                
          
              </MDBDropdown>
            </MDBNavItem>
          </MDBNavbarNav>
          <MDBNavbarNav right>
            <MDBNavItem>
              <MDBFormInline waves>
                <div className="md-form my-0">
                  <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search" />
                </div>
              </MDBFormInline>
            </MDBNavItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBNavbar>

      <Route path="/Login" exact Component={Login} />
      <Route path="/" exact Component={join} />
      <Route path="/" exact Component={Mypage} />
      <Route path="/" exact Component={Home} />
      </Router>
    );
  }
}

export default NavbarPage;
